import React, { useState } from 'react';

export default function SignupActivtie() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [activity, setActivity] = useState('');
  const [errors, setErrors] = useState({});

  const handleSubmit = (event) => {
    event.preventDefault();
    // Validate form data here
    // If valid, send data to backend API
    console.log('Form submitted:', firstName, lastName, email, password, confirmPassword, activity);
  };

  return (
    <div className="signup-form">
      <h1>inscrie maintenant!</h1>
      <form onSubmit={handleSubmit}>
        <label>prenom:</label>
        <input
          type="text"
          value={firstName}
          onChange={(event) => setFirstName(event.target.value)}
          placeholder="First Name"
        />
        <br />
        <label>nom:</label>
        <input
          type="text"
          value={lastName}
          onChange={(event) => setLastName(event.target.value)}
          placeholder="Last Name"
        />
        <br />
        <label>Email:</label>
        <input
          type="email"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
          placeholder="Email"
        />
        <br />
        <label>date de naissance:</label>
        <input
          type="date"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
          placeholder="birthdate"
        />
        <br />
        <label>num√©ro de telephone:</label>
        <input
          type="number"
          value={password}
          onChange={(event) => setPassword(event.target.value)}
          placeholder="number"
        />
        <br />
     
        <button type="submit">s'inscrie</button>
      </form>
      {errors && (
        <div className="error-messages">
          {Object.keys(errors).map((key, index) => (
            <p key={index}>{errors[key]}</p>
          ))}
        </div>
      )}
    </div>
  );
}
